import React from "react";
import { View, ImageBackground } from "react-native";
import { connect } from "react-redux";
import { logoutUser } from "../../utilities/actions/auth";
import AppButton from "../../components/UI/AppButton";
import { ScrollView } from "react-native-gesture-handler";
import AppPaddedView from "../../components/UI/AppPaddedView";
import Spacing from "../../components/Spacing";
import png from "../../assets/png";
// import { HeaderTitle } from "@react-navigation/stack";

function Advert(props) {
  return (
    <View style={{ flex: 1 }}>
      <ScrollView>
        <Spacing />
        <AppPaddedView>
          <ImageBackground source={png.Brands} />
          <AppButton title="Sign Out" onPress={() => props.logoutUser()} />
        </AppPaddedView>
      </ScrollView>
    </View>
  );
}

const mapStateToProps = (state) => {
  const { auth } = state;
  return { auth };
};

const mapDispatchToProps = (dispatch) => {
  return {
    logoutUser: () => dispatch(logoutUser()),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Advert);
